async function checkInvaliDate(t){try{var a=await fetch("/api/data/check-invaliDate",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({sessionStartTime:t})});if(a.ok)return(await a.json()).logSession;throw await a.text(),new Error("Network response was not ok")}catch(t){}}export{checkInvaliDate};